export type GameConfig =  {
  [key: string]: {
    icon:string,
    data:Game[]
  }
}
export type Game = {
  code:string,
  name:string,
  img: string,
  rtp?: {
    rtp: number,
    jam: string,
    pola: string[],
    color: string
  }
}
const stringToCode = (value:String) => {
  let result = 0
  for(let i = 0 ; i<value.length ;i++){
    result += value.charCodeAt(i);
  }
  return result
}
const gameBankWithRTP = () => {
  let resultGame = gameBank
  const d = new Date();
  const dateInit = Math.pow((d.getUTCDay()+1) + d.getUTCFullYear() * (d.getUTCMonth()+1) * d.getUTCDate() , d.getUTCHours() * (d.getUTCMinutes()<30?1:2))
  const polaInit = { 
    random : ["✔️✖️✖️","✖️✔️✖️","✖️✖️✔️","✔️✖️✔️","✖️✔️✔️","✖️✖️✖️"],
    random2 : [10, 20, 50, 70, 80],
    random3 : ["Auto", "Auto", "Manual 3", "Manual 5", "Manual 7", "Manual 9", "Auto", "Auto", "Auto", "Auto", "Auto", "Auto"],
  }
  Object.keys(resultGame).map(item => {
    resultGame[item].data.map((game,index) => {
      let rtp
      const gameValue = stringToCode(game.name) + stringToCode(game.code)
      rtp = dateInit * gameValue
      if(index >= 0 && index <= 15)
        rtp = (rtp%27)+65
      else
        rtp = (rtp%83)+8
      if(rtp >= 30){
        let jam,pola=["","",""]
        const hour = (d.getUTCHours() + 7) % 24 
        const target = (rtp % 3) + 1
        const randomTarget = (hour + target) % 24 < 10? "0"+((hour + target) % 24): ((hour + target) % 24).toString()
        const min1 = (rtp % 60) < 10 ? "0"+(rtp % 60) : (rtp % 60).toString()
        const min2 = (rtp * d.getUTCDate()) % 60 < 10 ? "0"+((rtp * d.getUTCDate()) % 60) : ((rtp * d.getUTCDate()) % 60).toString()
        jam = (hour < 10?"0"+hour : hour )+ ":" + min1 + " - " + randomTarget + ":" + min2
        let p = [(gameValue+rtp)%6,(gameValue*2+rtp)%6,(gameValue*3+rtp)%6]
        const p2 = [(gameValue*4+rtp)%5,(gameValue*5+rtp)%5,(gameValue*6+rtp)%5]
        for (let j = 0; j < 3; j++) {
          for (let k = 0; k < 3; k++) {
            if (p[j] == p[k] && j != k) {
                p[k] = (p[k] + 1) % 6;
            }
        }
        let p3 = [Math.pow(p[0], p2[0]) % 12, Math.pow(p[1], p2[1]) % 12, Math.pow(p[2], p2[2]) % 12];
        for (let j = 0; j < 3; j++) {
          if (polaInit.random3[p3[j]] == "Auto") {
              pola[j] = polaInit.random2[p2[j]] + " " + polaInit.random[p2[j]] + " " + polaInit.random3[p3[j]];
          } else {
              pola[j] = polaInit.random3[p3[j]] + " " + polaInit.random[p[j]];
          }
        }
        const color = rtp >= 80?"#28a745": rtp>= 30 ?"#ffc107":"#dc3545"
        game.rtp = {
          rtp,
          jam,
          pola,
          color
        }
      }
      }else {
        game.rtp = {
          rtp : rtp,
          jam : "-",
          pola: ["DISARANKAN","RTP GAME","30% KE ATAS"],
          color: "#dc3545"
        }
      }
    })
  })
  return resultGame
}

export {gameBank,gameBankWithRTP}